    "data": {},
    "conditions": {},
    "onEvent": [],
    "lifecycleHooks": {
        "render": "render"
    },
    "props": {
        "prop": {
            "type": "field"
        },
        "change-action": {
            "type": "string"
        },
        "quick-nav": {
            "type": "string"
        }
    },
    "_viewModelId": "AwDate",
    "_uniqueViewModelId": "AwDate",
    "ctx": {}
};




/*
define component
*/
const Component = createComponent( declViewModelJson, awDateRenderFunction, undefined, ctxImportObj );

export default Component;
